body.query:
{
  pools(first: 1000 where: {liquidity_gt: 0 volumeUSD_gt: 0}  orderBy: volumeUSD orderDirection: desc) {
      id
      token0 {id symbol name}
      token1 {id symbol name}
      token1Price volumeToken0 volumeToken1
  }
}

{
  blocks(
    first: 1,
    orderBy: timestamp,
    orderDirection: desc,
    where: {
      timestamp_gt: 1627305331,
      timestamp_lt: 1627305931
    }
  ) {
    number,
    timestamp
  }
}
